@RunWith(SpringRunner.class)
@SpringBootTest
@AutoConfigureMockMvc
@TestPropertySource(
    locations = "classpath:application-test.properties")
public class TemplateControllerTest {

  @Autowired
  private MockMvc mockMvc;

  @Autowired
  private TemplateController templateController;

  private static final String description = "Test template description";
  private static final String name = "Test template name";
  private static final String token = "eyJhbGciOiJIUzUxMiJ9..-1hLdmXQO0xLJkSPA3qm9kvGsGpamfHWMJ6b3XQnJVxmDi_dUgVCtYQFELe7Qk5hak-d6TpQ8b6H7FJQTTAjHg";
  private static final String image = "";

  @Test
  public void createTemplate() throws Exception {
    Path path = Paths.get("C:\\Users\\ThaiT\\Pictures\\Saved Pictures\\2.png");
    String imgName = "2.png";
    String originalFileName = "2.png";
    String contentType = "image/png";
    byte[] content = null;
    try {
      content = Files.readAllBytes(path);
    } catch (final IOException e) {
      e.printStackTrace();
    }
    MultipartFile file = new MockMultipartFile(imgName,
        originalFileName, contentType, content);
    List<Integer> categories = new ArrayList<>();
    categories.add(1);
    categories.add(2);
    categories.add(3);
    TemplateCreateRequest request = TemplateCreateRequest
        .builder()
        .rawTemplateId(1)
        .categoryIds(categories)
        .description(description)
        .name(name)
        .thumbnail(file)
        .build();
    mockMvc.perform(post("/template")
        .content(asJsonString(request))
        .header("Authorization", "Bearer " + token)
        .contentType(MediaType.APPLICATION_JSON))
        .andExpect(status().isOk())
        .andExpect(content().contentType("application/json;charset=UTF-8"))
        .andExpect(jsonPath("$.success").isBoolean())
        .andExpect(jsonPath("$.message").value("Template created"))
        .andExpect(jsonPath("$.data.id").isNumber())
        .andExpect(jsonPath("$.data.name").value(name))
        .andExpect(jsonPath("$.data.authorName").isString())
        .andExpect(jsonPath("$.data.authorId").isString())
        .andExpect(jsonPath("$.data.thumpnail").isString())
        .andExpect(jsonPath("$.data.upVote").isNumber())
        .andExpect(jsonPath("$.data.downVote").isNumber())
        .andExpect(jsonPath("$.data.active").isBoolean())
        .andExpect(jsonPath("$.data.description").value(description))
        .andExpect(jsonPath("$.data.categories").hasJsonPath());
  }
}
